Lionel Messi 🇦🇷 se quedará en Barcelona  hasta Junio de 2021, dónde finalizará su contrato con la entidad blaugrana. Hoy en una entrevista con @goalenespanol confirmo que seguirá en el club, pero que su intención fue salir a final de la temporada 2019/20 🔙 como decía su contrato, pero el presidente 👨🏻‍💼 "No cumplió su palabra". Hizo de capitán, de lider, de referente y por sobre todo, de hincha del Barcelona. 🇪🇸 Desenmascaró al presidente después de muchos años de mala gestión, lo expuso ante todo el mundo. Y puso al club por encima de su bien personal. #ElGran10 
