Con la afirmación de que Messi seguirá un año mas en el Barcelona me dió por pensar varias cosas respecto al tema.

En primera como Barcelonista estoy feliz que Messi siga pero a la vez no, creo que su salida hubiera venido bien a jugadores como Dembele, Coutinho,etc. ¿Porque digo esto? Coutinho juega en la misma area en la que Messi suele desenvolverse más, entonces ¿dejas en la banca a Coutinho? ¿Lo vuelves a poner en banda y que no vuelva a rendir? Eso por Coutinho.

Dembele, en un caso que pongas a Cou de extremo, ¿lo dejarías en la banca igual? Pasa lo mismo, no le das continuidad a Dembou que es la que le ha faltado en toda su estancia aqui.

Que decir de Ansu Fati, misma pregunta, ¿Lo dejas en banca? ¿Pones a Coutinho o Dembele? OJO no estoy diciendo que Messi sea malo y que ya no da más pero realmente nos hubiera beneficiado que saliera, obviamente nadie nos daría la cantidad de goles y asistencias que él nos da.

Esto sin mencionar a Trincao, Pedri; si se llega a fichar a Depay, si se queda Suarez (Que parece que si saldrá). O vendes a uno o dos jugadores en ataque o habrá muchos problemas para que todos tengan continuidad.

Si Bartomeu aceptará alguna oferta que no hubiese sido su clausula, yo si lo hubiera vendido, teniendo en claro en que el trato muy injusto que se le dió no se lo merecía. Te libras de su altisimo salario y obtienes un dinero que, vamos, nos hace falta, no para fichar, para sanear las malas finanzas de esta directiva.

Pero sin duda alguna Messi seguirá siendo Messi y nos aportará mucho en ataque, es un opinion, no busco ofender a nadie y si alguien gusta comentar con gusto escucho opiniones. Gracias.

